    attribution: '&copy; OpenStreetMap contributors'
}).addTo(map);

const sectorLayers = {};
let highlightedLayer = null;

function defaultStyle(feature) {
    return {
        color: "black",
        weight: 1.5,
        fillColor: feature.properties.fill_color,
        fillOpacity: 0.6
    };
}

function createGeoJsonLayer() {
    return L.geoJSON(geojsonData, {
        style: defaultStyle,
        onEachFeature: function (feature, layer) {
            const name = feature.properties.name;
            const rationale = feature.properties.Rationale || '';
            layer.bindTooltip(`<b>${name}</b><br>${rationale}`);
            sectorLayers[feature.properties.id] = layer;
        }
    }).addTo(map);
}

const geoJsonLayer = createGeoJsonLayer();

    for (const id in sectorLayers) {
        const layer = sectorLayers[id];
        if (!selected || id === selected) {
            layer.setStyle({
                fillOpacity: 0.6,
                weight: id === selected ? 3 : 1.5,
                color: id === selected ? "red" : "black"
            });
            if (id === selected) {
                map.fitBounds(layer.getBounds(), { padding: [20, 20] });
                highlightedLayer = layer;
                layer.bringToFront();
            }
        } else {
            layer.setStyle({ fillOpacity: 0, weight: 0, color: "transparent" });
        }
    }
});

function resetMap() {
    for (const id in sectorLayers) {
        const layer = sectorLayers[id];
        layer.setStyle({
            fillOpacity: 0.6,
            weight: 1.5,
            color: "black"
        });
    }
    document.getElementById("sectorSelect").value = "";
    map.setView([24.466667, 54.366669], 6);
}
</script>
